import PropType from 'prop-types'


const Header = ({ title }) => {
    return (
        <header>
            <h1>{title}</h1>
        </header>
    )
}

Header.defaultProps = {
    title: "Google Search",
}

Header.propTypes = {
    title: PropType.string,
}

export default Header
